import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Route exact path='/' component={Home} />
      </Router>
    </>
  );
}

const Home = () => {
  return <h1>Home</h1>;
};

export default App;
